window.bookSummaryJSON = "<p><b>Ever wish your real life was more like a video game? Be careful what you wish for!</b></p> <p>Felix thinks he is losing his mind when he starts getting game-like quest notifications on his phone. But then, things get really strange when he realizes he is now able to level-up in real life.</p> <p>After gaining the rare Beastmaster class and bonding himself to a particularly bloodthirsty housecat, Felix finds himself in a race against time to defeat his high school nemesis - who may now be a seven-foot-tall ogre with anger issues - and save the world.</p> <p>When zombies roam the streets and even the squirrels are out for blood, Felix finds out that itâ€™s not that easy when your life becomes...gamified.</p>"; 
